import PropTypes from 'prop-types'

const Header = ({ title }) => {
    return (
        <header className='header'>
            <h1>{title}</h1>
            <button className='btn btn-danger'>Add</button>
        </header>
    )
}

Header.defaultProps = {
  title: 'Task tracker'
}

Header.propTypes = {
    title: PropTypes.string.isRequired
}

/* CSS in JS
const headingStyle = {
color: 'red', backgroundColor: 'black'
} */

export default Header
